  false,\n\t\"url\": null,\n\t\"notes\": \"LOCATION: Lat. 39036u201919u201dN, long.
  9307u201948u201dW near Swan Lake NWR, 23.5 miles southeast of Chillicothe, MO, in
  Charlton County. Gage is mounted 9 feet off the ground on a tree in the woods downstream
  of the bridge on the left bank. DRAINAGE AREA: 414 square miles SURFACE WATER RECORDS
  PERIOD OF RECORD: June 24, 2010 to present. GAGE SITE: Design Analysis 522+ in communication
  with Esterline pressure transducer in a square metal gage house. GOES antenna in
  communication with DA 522+ DCP transmits every hour in a 10 second window at a baud
  rate of 300.Instruments are powered by a solar panel run to a battery through a
  Sunsaver power regulator. Solar panel, GPS and GOES antennas are attached to a mast
  connected to the gage house. Stage is collected at 15u2010minute intervals. Weekly
  gage height data available online, NWS Id is MDOM7. Datum of gage is in North American
  Vertical Datum of 1988. NATIONAL WILDLIFE REFUGE: Swan Lake NWRREMARKS: Records
  coded fair for 2012 calendar year. EXTREMES FOR PERIOD OF RECORD: Maximum gage height,
  676.81 ft, June 28, 2010; minimum gage height, 660.37 ft, August 23, 2012.EXTREMES
  FOR CURRENT YEAR: Maximum gage height, 676.42 ft, April 14; minimum gage height,
  660.37 ft, August 23.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
